import React, { useState, useEffect } from 'react';
import WebSocketTest from './WebSocketTest';

function Competition() {

  useEffect(() => {
    // Fetch selected group data from the server
    axios.get('http://localhost:8000/api/selectedGroups')
      .then((response) => {
        const selectedGroups = response.data;
        // Update your state or do something with the data
      })
      .catch((error) => {
        console.error('Error fetching selected groups:', error);
      });
  }, []);

  return (
<div>
  <h1></h1>
</div>
  );
}

export default Competition;
